('2026','2','8262','Wohnung Martin',Null,'Modern renovierte Wohnung mit Panorama- Meerblick in Santa Ponsa','26006','Diese Wohnung, mit ca. 75 m²  Wohnfläche befindet sich in Südlage mit Blick über die Bucht und den Strand von Santa Ponsa.\r\nDie Wohnung wurde vor ein paar Jahren komplett saniert und mit moderner Einrichtung ausgestattet. Sie bietet ein Wohnzimmer mit offener Einbauküche, Esszimmer im Wintergarten,  2 Schlafzimmer mit je ein Duschbad en suite. Von der ca. 25 m² großen Terrasse mit Jacuzzi-Badewanne kann man einen fantastischen Panorama-Meerblick genießen.  Ein PKW-Stellplatz ist vorhanden.\r\n','26007','350000','111','2013-05-03 14:00:23','106','2013-05-03 14:06:51',Null,'1837','121','878',1,'1','0',Null,Null,Null,'26008',Null,'0','0','0',Null,'2016-01-11 10:28:04',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'26009',Null,'26010',Null,'26011',Null,'26012',Null,'26013','0',0,'0');
